import React from "react";
import sun from "./sun.svg";
function Header() {
  return (
    <nav className="navbar">
      <img src={sun} alt="" srcset="" />
      <h2 className="navbar__heading">Myweather</h2>
    </nav>
  );
}

export default Header;
